import React from 'react';
import BinarySearchTree from './Trees/BinarySearchTree/BinarySearchTree.jsx/index.js'
import './TreeVisualizer.css';


export default class TreeVisualizer extends React.Component {
    constructor(props) {
        super(props);
        
        this.state = {
            tree: new BinarySearchTree()           
        };

        //this.initialize();
    }

    render() {
        this.initialize();
        return this.state.tree.createDOM();
    }

    componentDidMount() {
    }

    initialize() {
        this.state.tree.initialize();
    }
}
